import React, { Component } from "react";
import styled from "styled-components";
export class SubNavbar extends Component {
  render() {
    return (
      <SubNavbarWrapper>
        <div>hello</div>
      </SubNavbarWrapper>
    );
  }
}

const SubNavbarWrapper = styled.nav`
  margin: 0;
`;
export default SubNavbar;
